import React, { Component } from 'react'
import Header from '../header/Header'
import Footer from '../footer/Footer'
import { Row } from 'antd'

export default class Detail extends Component {
    render() {
        return (
            <div>
                <Header />
                <Row>
                    <Col span={14} offset={5}>
                    </Col>
                </Row>
                <Footer />
            </div>
        )
    }
}
